import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './Components/home'
function App() {
  //<Route path="/" element={<Layout />}>
  return (
    <BrowserRouter>
      <Routes>       
          <Route index element={<Home />} />
          <Route path="/" element={<Layout />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
